import React, { useState } from 'react';
import './submitMessage.scss';
import Cheetah from './cheetah.jpg';

interface SubmitMessageProps {
    classNameAdded: string;
    submit: boolean;
    submitted: boolean;
}

const SubmitMessage = ({ classNameAdded = '', submit = false, submitted = false }: SubmitMessageProps): JSX.Element => {

    return (
        <div className={`submitMessage ${classNameAdded} ${submit || submitted ? "submitMessage--visible" : ""}`}>
            <span className={`submitMessage__thanks-1 ${submitted ? "submitMessage__thanks-1--visible" : ""}`}>Thank you for your message.</span>
            <img className="submitMessage__cheetah-image" src={Cheetah} />
            <span className={`submitMessage__thanks-2 ${submit ? "submitMessage__thanks-2--visible" : ""}`} >Thank you for your message.</span>
        </div>
    );
}

export default SubmitMessage;
